import React from 'react';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';

const Profile = () => {
  return (
    <div>
      <Container>
        <Row className="my-store-header">
          <Col>
            <h2>My Store</h2>
          </Col>
          {/* Add icons and other elements as needed */}
        </Row>

        <C className="balance-info">
          <Col>
            Available balance: N76,030.00
            {/* Link or button for Sales History */}
            <Button variant="link">Sales History</Button>
          </Col>
        </C>

        <Row className="cash-out">
          <Col>
            <Button variant="primary">CashOut</Button>
          </Col>
        </Row>

        <Form className="search-store">
          {/* Replace with actual form elements and functionality */}
          <Form.Control type="text" placeholder="search your store..." />
        </Form>

        {/* Map through new orders and display them as list items */}
        {/* This is just a static example */}

        {['New Order 1', 'New Order 2', 'New Order 3'].map((order) => (
          // Replace with actual order data and structure
          // This is just a static example
          <li>{order}</li>
        ))}
      </Container>
    </div>
  );
};

export default Profile;
